        return new Source("{% extends 'base.html.twig' %}

{% block title %}Register{% endblock %}

{% block body %}
    <div class=\"container\">
        <h1 class=\"my-4\">Inscription</h1>

        <div class=\"alert alert-danger\" role=\"alert\">
            {{ form_errors(registrationForm) }}
        </div>

        {{ form_start(registrationForm, { 'attr': {'class': 'needs-validation', 'novalidate': 'novalidate'} }) }}
        <div class=\"mb-3\">
            {{ form_row(registrationForm.username, {
                'label': 'Pseudo',
                'attr': {'class': 'form-control', 'placeholder': 'Entrer un pseudo'}
            }) }}
        </div>
        <div class=\"mb-3\">
            {{ form_row(registrationForm.mailAddress, {
                'label': 'Adresse mail',
                'attr': {'class': 'form-control', 'placeholder': 'Entrer une adresse mail'}
            }) }}
        </div>
        <div class=\"mb-3\">
            {{ form_row(registrationForm.plainPassword, {
                'label': 'Mot de passe',
                'attr': {'class': 'form-control', 'placeholder': 'Enter your password'}
            }) }}
        </div>
        <div class=\"form-check mb-3\">
            {{ form_row(registrationForm.agreeTerms, {
                'label': 'Termes acceptés',
                'attr': {'class': 'form-check-input'}
            }) }}
            <label class=\"form-check-label\" for=\"agreeTerms\">
                J'accepte les termes et conditions
            </label>
        </div>

        <button type=\"submit\" class=\"btn btn-primary\">Valider</button>
        {{ form_end(registrationForm) }}

        <p class=\"text-center mt-3\">
            <span>Vous avez déjà un compte ?</span>
            <a href=\"/login\">S'inscrire</a>
        </p>
    </div>
{% endblock %}", "registration/register.html.twig", "C:\\Users\\Maxime\\PhpstormProjects\\mini-reseau-social-symfonyV3\\templates\\registration\\register.html.twig");
